sys_variable_value.value:
(function execute(inputs, outputs) {

  const repoDetails = JSON.parse(inputs.reponse_body);
  outputs.id = repoDetails.id;
  outputs.name = repoDetails.name;
  outputs.default_branch = repoDetails.default_branch;
  outputs.ssh_url = repoDetails.ssh_url;
  outputs.private = repoDetails.private;

  if (repoDetails.parent) {
    const repoParent = repoDetails.parent;
    const repoOwner = repoParent.owner;

    outputs.parent = {
      id: repoParent.id,
      name: repoParent.name,
      full_name: repoParent.full_name,
      owner: {
        id: repoOwner.id,
        login: repoOwner.login
      }
    };
  }

})(inputs, outputs);

